  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for DeSoto National
  Wildlife Refuge outlines Refuge accomplishments from September through December
  of 1962. The report begins by summarizing the weather conditions, habitat conditions,
  water conditions, and food and cover during this period. Wildlife- including migratory
  birds, upland game birds, big game animals, furbearers, predators, rodents, raptors,
  and fish- is also covered. The Refuge development and maintenance section discusses
  physical developments, plantings, vegetation control, and collections and receipts.
  A progress report on field investigations and applied research is also provided.
  The public relations section of the report describes recreational uses, Refuge visitors,
  Refuge participation, violations, hunting, and safety. Items of interest, N-R forms,
  newspaper articles, and photographs are attached.\",\n\t\"license_title\": \"License
